import React from 'react'

const CountryInfo = ({country}) => {
    console.log(country)
    return(
        <div>
            <h1>{country.name}</h1>
            Capital: {country.capital}
            Population: {country.population}
            <h3>Laguages</h3>
            
            <img src={country.flag} alt={country.name}/>
        </div>
    )
}

export default CountryInfo
